var chatBoxes = new Array();            //Array contains all chatboxes

//User select to chat with another user
function chatWith(chatuser) {
    createChatBox(chatuser);
//    alert('test');
}

//Make div .chatboxtextarea editable
function initEditable(chatboxtitle) {
	var editor = document.getElementById("txt_" + chatboxtitle);
	if ('contentEditable' in editor) {
		editor.contentEditable = true;
	} else { // for firefox older than version 3.0
		alert("Error when make div editable");
	}
}


//Count number of visible chatboxes
function countVisibleChatboxes() {
    var chatBoxeslength = 0;
    var allBoxes = chatBoxes.length;    //Number of all chatboxes
    for (var i = 0; i < allBoxes; i++) {
        if ($("#chatbox_" + chatBoxes[i]).css("display") != "none") {
            chatBoxeslength++;
        }
    }
    return chatBoxeslength;
}

//Initiate chat box to chat with 1 user
