//Toggle chat box size if it is minimized
function toggleChatBoxGrowth(chatboxtitle) {
    if ($("#chatbox_" + chatboxtitle + " .chatboxview").css("display") == "none") {
        $("#chatbox_" + chatboxtitle + " .chatboxview").css("display", "block");
    } else {
        $("#chatbox_" + chatboxtitle + " .chatboxview").css("display", "none");
    }
}

//Close chatbox
function closeChatBox(chatboxtitle) {
    $("#chatbox_" + chatboxtitle).css("display", "none");
    reStructureChatboxes();
}

//Restruct all chatboxes
function reStructureChatboxes() {
    align = 0;
    for (var i = 0; i < chatBoxes.length; i++) {
        if ($("#chatbox_" + chatBoxes[i]).css("display") != "none") {
            if (align === 0) {
                $("#chatbox_" + chatBoxes[i]).css("right", "283px");
            } else {
                var rightPos = align * (260 + 7) + 283;
                $("#chatbox_" + chatBoxes[i]).css("right", rightPos + "px");
            }
            align++;
        }
    }
}